import React from 'react';
import { Container } from 'semantic-ui-react';

const Footer = (props) => {
    return (

        <div style={{ paddingTop: '1vh', paddingBottom: '10vh', marginTop: '4vh',  background: '#fff'}}> 

            <Container>
        <h3> Carbon Forecast</h3>   
        <h2> {props.emissions} C02-e </h2>
        <h4>Total emissions in tonnes produced since you opened this app (C02-e)</h4>  
        </Container>

        </div>
    );
}

export default Footer;
